import React, { useState } from "react";
import "./styles/plan.css";

const Plan = () => {
  return (
    <div className="plan">
      <div className="header-card">
        <p>Plan</p>
      </div>
      <div className="list-container">
        <ul className="cards"></ul>
      </div>{" "}
    </div>
  );
};

export default Plan;
